text:
jq -n '{ 
  "tgs": {
    "v": "1.0",
    "fr": 30,
    "iw": 512,
    "ih": 512,
    "layers": [
      {
        "id": 1,
        "ty": 4,
        "d": {
          "x": 0,
          "y": 0,
          "w": 512,
          "h": 512
        }
      }
    ]
  }
}' > animation.json

ffmpeg -i animation.mp4 -vf scale=512:512 output_%03d.png

zip animation.tgs animation.json output_*.png
